import Layout from "../components/Layout"

class HomePage extends React.Component{
  constructor(props){
    super(props)
    this.state = {
      'startedTypeWriter': false
    }
  }
  componentDidMount(){
    if(this.state.startedTypeWriter == false){
      var text = `PDanielY`
      var dom = document.getElementById('name')
      var i = 0
      a = setInterval(()=>{
        if(text[i] == undefined){
          clearInterval(a)
        }
        dom.innerHTML = dom.innerHTML + text.charAt(i)
        i++
      },50)
    }
  }
  render(){
    return (
      <Layout>
        <style jsx>{`
          *{
            font-family: 'Arial';
            text-align: center;
          }
          .social{
            margin: auto;
          }
          .social *{
            display: inline-block;
          }
          .social img{
            border: 0px solid;
            border-radius: 10px 10px;
            width: 25px;
            height: 25px;
            cursor: pointer;
            padding-right: 5px;
          }
        `}</style>
        <h1 id="name">PDanielY</h1>
        <div className="social">
          <a href="https://repl.it/@PDanielY"><img src="https://repl.it/public/images/favicon.ico"/></a>
          <a href="https://twitter.com/plop_daniel"><img src="https://twitter.com/favicon.ico"/></a>
        </div>
        <p>Use the sidebar to navigate the page</p>
      </Layout>
    )
  }
}

export default HomePage
